// ðŸ”’ Suppress ResizeObserver loop errors BEFORE React Dev Overlay sees them
const observerErrorHandler = (e) => {
  const message = e?.message || "";
  if (
    typeof message === "string" &&
    (
      message.includes("ResizeObserver loop limit exceeded") ||
      message.includes("ResizeObserver loop completed with undelivered notifications")
    )
  ) {
    e.stopImmediatePropagation(); // â›” stop from reaching React's error overlay
    e.preventDefault();
    return false;
  }
};

window.addEventListener("error", observerErrorHandler);
window.addEventListener("unhandledrejection", observerErrorHandler);

// React App Entry
import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
